import React from 'react';
import GridListTile from '@material-ui/core/GridListTile';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import SearchIcon  from '@material-ui/icons/Search';
import IconButton from '@material-ui/core/IconButton';
import axios from 'axios';
import FilmCard from './film-card';
import './film-search.scss'
import GridList from '@material-ui/core/GridList';
import ListSubheader from '@material-ui/core/ListSubheader';

class FilmSearch extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          searchInputFilm:'',
          doctorList:[],
        };
        this.handleChange = this.handleChange.bind(this);
        this.seachAction = this.seachAction.bind(this);
      }
      handleChange(event) {
        const filmInputValue=event.target.value
        this.setState({searchInputFilm: filmInputValue});
      }
      async componentDidMount(){
        axios.get('http://localhost:8081/doctor')
        .then(res => {
          const doctorListApi = res.data;
          this.setState({
            doctorList:doctorListApi,
            });
        })
      }
    render() {
        const {doctorList}=this.state
        return (
            <div className="content-search">

                <GridList  className='gridList'>
                <GridListTile key="Subheader" cols={2} style={{ height: 'auto' }}>
                  <ListSubheader className='subtitle-film-header' component="div">Liste des Medecins</ListSubheader>
                </GridListTile>
                {doctorList.map(doctor => (
                  <FilmCard key={doctor.show.id}
                  film={film} 
                  />
              ))}
              </GridList>
            }
          </div>
        );
    }
}
export default FilmSearch;
